import React, { Component } from 'react'
import { BrowserRouter as Router, Route, Link } from 'react-router-dom'
import NavBar from '../Components/NavBar.js'



class HomePage extends Component{
  render(){
    return(
      <div>
        <NavBar />
        <p>Hello world</p>
      </div>
    )
  }
}




export default HomePage;
